class TestGooglon(unittest.TestCase):

    def setUp(self):
        from googlon import Googlon
        self.googlon = Googlon()

    def test_isBar(self):
        self.assertEqual(self.googlon.isBar("a"), False)
        self.assertEqual(self.googlon.isBar("c"), True)
        self.assertEqual(self.googlon.isBar("l"), True)
        self.assertEqual(self.googlon.isBar("x"), True)
        self.assertEqual(self.googlon.isBar("3"), False)
        
    def test_isPreposition(self):
        self.assertEqual(self.googlon.isPreposition("xxx"), True)
        self.assertEqual(self.googlon.isPreposition("xxxx"), False)
        self.assertEqual(self.googlon.isPreposition("xxa"), False)
        self.assertEqual(self.googlon.isPreposition("xmx"), False)
        self.assertEqual(self.googlon.isPreposition("30x"), True)
        
    def test_isVerb(self):
        self.assertEqual(self.googlon.isVerb("xxx"), False)
        self.assertEqual(self.googlon.isVerb("xxxxxxx"), True)
        self.assertEqual(self.googlon.isVerb(""), False)
        self.assertEqual(self.googlon.isVerb("asdjadkjh"), True)
        self.assertEqual(self.googlon.isVerb("ajsdhakhdi"), False)
        
    def test_isVerbInFirstPerson(self):
        self.assertEqual(self.googlon.isVerbInFirstPerson("xxxxxxx"), True)
        self.assertEqual(self.googlon.isVerbInFirstPerson("hsdjadkjh"), True)
        self.assertEqual(self.googlon.isVerbInFirstPerson("asdjadkjh"), False)
        
    def test_isPrettyNumber(self):
        self.assertEqual(self.googlon.isPrettyNumber(1), False)
        self.assertEqual(self.googlon.isPrettyNumber(4), False)
        self.assertEqual(self.googlon.isPrettyNumber(502344), True)
        self.assertEqual(self.googlon.isPrettyNumber(502345), False)
        self.assertEqual(self.googlon.isPrettyNumber(50238371), False)
        
    def test_prepositions(self):
        self.assertEqual(self.googlon.prepositions("bnv"), ["bnv"])
        self.assertEqual(self.googlon.prepositions("basdadnv"), [])
        self.assertEqual(self.googlon.prepositions("kjasdhja"), [])
        self.assertEqual(self.googlon.prepositions("qzaslkjaldjb"), [])
        self.assertEqual(self.googlon.prepositions("rph"), ["rph"])
        self.assertEqual(len(self.googlon.prepositions(TEXT_A)), 62)
        
    def test_verbs(self):
        one = "nhmpxszx zlqsqsv wdmgvvdq xzrrlpdp txvnmgc nhmpxszx wdmgvvdq xzrrlpdp rthjfxm nbslwln"
        self.assertEqual(len(self.googlon.verbs(one)[0]), 10)
        self.assertEqual(len(self.googlon.verbs(one)[1]), 8)
        
        two = ""
        self.assertEqual(len(self.googlon.verbs(two)[0]), 0)
        self.assertEqual(len(self.googlon.verbs(two)[1]), 0)
        
        self.assertEqual(len(self.googlon.verbs(TEXT_A)[0]), 149)
        self.assertEqual(len(self.googlon.verbs(TEXT_A)[1]), 123)
        
    def test_vocabulary(self):
        one = "skpbrjs ncmlb nhmpxszx qgqnt rgfchmt"
        self.assertEqual(self.googlon.vocabulary(one), "rgfchmt skpbrjs ncmlb nhmpxszx qgqnt")
        two = "skpbrjs ncmlb rgfchmt nhmpxszx qgqnt rgfchmt"
        self.assertEqual(self.googlon.vocabulary(two), "rgfchmt skpbrjs ncmlb nhmpxszx qgqnt")
        self.assertEqual(self.googlon.vocabulary(TEXT_A), ASSERT_A)
        
    def test_number(self):
        self.assertRaises(ValueError, self.googlon.number, ("rgfchmt skpbrjs ncmlb nhmpxszx qgqnt"))
        self.assertEqual(self.googlon.number("skpbrjs"), 503186627)
        
    def test_distinctPrettyNumbers(self):
        self.assertEqual(len(self.googlon.distinctPrettyNumbers("jqh")), 0)
        self.assertEqual(len(self.googlon.distinctPrettyNumbers(TEXT_A)), 92)

if __name__ == '__main__':
    unittest.main()
